import { TIMESTAMP } from './util/timestamps';
import { generateId } from '../../../shared/idGen';
import { NewAnnotationMemberInput, NewDocumentMemberInput } from '../../../types/resolvers-types'
// enforces T1 but makes T2 optional as well as 'id', 'createdAt' and '__typename' optional
type PartialEntity<T1, T2 extends keyof T1> = Partial<{
  [P in Exclude<keyof T1, T2>]: T1[P]
} & {
    [S in T2]?: T1[S]
  } & {
  id: string;
  createdAt: string;
  __typeName: string;
  lastRead: string;
}> & Pick<T1, Exclude<keyof T1, T2 | 'id' | 'createdAt' | 'updatedAt' | '__typename' | 'lastRead'>>

type FullEntity<T> = T & { createdAt: number; id: string; updatedAt: number; };

export async function createEntity <Entity, Ignore extends keyof Entity = never>(data: PartialEntity<Entity, Ignore>): Promise<FullEntity<Entity>> {
  const now = TIMESTAMP;
  const id: string = data.id || (await generateId());
  const createdAt = data.createdAt || now;
  const updatedAt = now;
  return {
    ...data,
    id,
    createdAt,
    updatedAt
  } as unknown as FullEntity<Entity>
}

type CreateMemberInput = (NewAnnotationMemberInput | NewDocumentMemberInput) & {
  lastRead: number | string,
  annotationCreatedAt?: number
}

export const createMember = async <T extends CreateMemberInput>(data:  PartialEntity<T, never>): Promise<T> => {
  const now = TIMESTAMP;
  const id: string = await generateId();
  const lastRead = data.lastRead || now;
  const createdAt = data.createdAt || now;
  const updatedAt = now;
  return ({
    ...data,
    lastRead,
    id,
    createdAt,
    updatedAt
  } as unknown) as T
}
